	public static String minWindow(String s, String t) {
       Map<Character, Integer> tMap = new HashMap<>();
        for(char c: t.toCharArray()) {
            tMap.put(c, tMap.getOrDefault(c, 0) + 1);
        }
        int req = tMap.keySet().size();
        int have = 0;

        Map<Character, Integer> sMap = new HashMap<>();
        int[] arr = {-1, -1, 0};
        String result = "";
        int prev=0;
        int curr=0;
        
        while(curr<s.length()) {
        	char c = s.charAt(curr);
        	if(tMap.containsKey(c)) {
        		sMap.put(c, sMap.getOrDefault(c, 0)+1);
        		if((int) tMap.get(c)== (int) sMap.get(c)) {        			
        			have++;
        		}
        	}
    		while(prev<=curr && have==req) {
    			if(arr[2]==0 || arr[2]>curr - prev + 1) {
    				arr[0] = prev;
	    			arr[1] = curr;
	    			arr[2] = curr - prev + 1;
    			}
    			char prevChar = s.charAt(prev++);
    			if(sMap.containsKey(prevChar)) {
    				sMap.put(prevChar, sMap.get(prevChar) - 1);
	    			if(sMap.get(prevChar)<tMap.get(prevChar)) {
	    				have--;
	    			}
    			}
    		}
    		curr++;
        }
        return arr[2]>0 ? s.substring(arr[0], arr[1]+1) : "";
    }

     public static String minWindow2(String s, String t) {
        Map<Character, Integer> tMap = new HashMap<>();
        
        for(int i=0; i<t.length(); i++) {
            char c = t.charAt(i);
            tMap.put(c, tMap.getOrDefault(c, 0) + 1);
        }
        
        String result = "";
        Map<Character, Integer> sMap = new HashMap<>();
        
        int prev = 0;
        int curr = 0;
        
        while(curr<s.length()) {
            char c = s.charAt(curr);
            if(tMap.containsKey(c)) {
                if(!sMap.containsKey(c)) {
                    sMap.put(c, 1);
                }
                else if(sMap.get(c)<tMap.get(c)) {
                    sMap.put(c, sMap.get(c)+1);
                }
                if(sMap.equals(tMap)) {
                    while(prev<=curr) {
                        
                        if(sMap.equals(tMap) && (result.isEmpty() || result.length() > curr-prev+1)) {
                            result = s.substring(prev, curr+1);
                        }
                        char prevChar = s.charAt(prev);
                        if(sMap.containsKey(prevChar)) {
                            if(sMap.get(prevChar)==1) sMap.remove(prevChar);
                            else sMap.put(prevChar, sMap.get(prevChar)-1);
                        }
                        prev++;
                    }
                }
            }
            curr++;
        }
        return result;
    }
